import React from 'react';

const Card = () => {
    return (
        <div>
            <div className="card">
                <picture>
                    <img src={this.props.picture} alt="card1" />
                </picture>
                <div className="layer">
                    <i onClick={this.props.openModal} className="text-white fa-solid fa-plus fa-6x"></i>
                </div>
            </div>
        </div>
    );
};

export default Card;
